const WordBreak = props => {
  return (
    <>
      <div className="wordbreak"></div>
      <style>{`
    .wordbreak {
      width: 80%;
      height: 2px;
      background-color: #252b3338;
      margin: 0 auto;
    }
  `}</style>
    </>
  );
};

export default WordBreak;
